import React from 'react';

import { ProgramName, FieldHeader, FieldValue, Container, CollegeName, Logo } from './ProgramRow.styles';

import Santa from '../../assets/santarosajuniorcollege.svg'

const ProgramRow = () => (
    <Container>
        <Logo></Logo>
        <ProgramName>Information Technology</ProgramName>
        <CollegeName>Santa Rosa Junior College</CollegeName>
        <FieldHeader start={4} end={5}>Degree Type</FieldHeader>
        <FieldValue start={4} end={5}>Associate's</FieldValue>
        <FieldHeader start={5} end={6}>Delivery</FieldHeader>
        <FieldValue start={5} end={6}>100% Fully Online</FieldValue>
        <FieldHeader start={6} end={7}>Annual Tuition</FieldHeader>
        <FieldValue start={6} end={7}>$1,375</FieldValue>
    </Container>
);

export default ProgramRow;
